import React from 'react';
import logo from "./img/logo.png"

export class Starter extends React.Component {
    render() {
        return (
            <div className="starter">
                <h1 className="starter-title">Snake</h1>
                <h2 className="starter-subtitle">by Philipp Bulanin</h2>
                <img className="sarter-logo" src ={logo} alt="logo"/>
                <button className="start-btn" onClick={this.props.start}>Start</button>
            </div>
        )
    }
}
